const api = 'http://127.0.0.1:5000'

// export const getAll = (address) =>
//   fetch(`${api}/analysis?address=${address}`)
//    .then(results => results.json())
//    .then(data => data)

export const getAll = (address) =>
  fetch(`${api}/analysis?address=${address}`)
   .then(response => {
     console.log(response.text())
     try {
       return response.json()
     }
     catch {
       return 'Incorrect Address'
     }
   })
   .then(data => {
     // console.log(data)
     return data
   })
